const MerriweatherSans300 = `@font-face { font-family: 'Merriweather Sans'; font-style: normal; font-weight: 300; src: local('Merriweather Sans Light'), local('MerriweatherSans-Light'), url('data:font/woff2;base64,') format('woff2'); }`;
const MerriweatherSans300italic = `@font-face { font-family: 'Merriweather Sans'; font-style: italic; font-weight: 300; src: local('Merriweather Sans Light Italic'), local('MerriweatherSans-LightItalic'), url('data:font/woff2;base64,') format('woff2'); }`;
const MerriweatherSansRegular = `@font-face { font-family: 'Merriweather Sans'; font-style: normal; font-weight: 400; src: local('Merriweather Sans'), local('MerriweatherSans-Regular'), url('data:font/woff2;base64,') format('woff2'); }`;
